import {BrowserRouter, Routes, Route} from 'react-router-dom'
import store from './pages/store'
import home from './pages/Homepage'


function App() {
  return (
  <div>
	<BrowserRouter>
		<Routes>
			<Route index Element={<home />}/>
			<Route path="/" exact component={<home/>} />
		</Routes>
	</BrowserRouter>
  </div>

  );
}



export default App;
